import * as React from 'react';
import PropTypes from 'prop-types';
import clsx from 'clsx';
import { withStyles } from '@mui/styles';
import { createTheme } from '@mui/material/styles';
import TableCell from '@mui/material/TableCell';
import Paper from '@mui/material/Paper';
import { AutoSizer, Column, Table } from 'react-virtualized';
import { DEFAULT_ENCODING } from 'crypto';
import ModeEditIcon from '@mui/icons-material/ModeEdit';
import DeleteIcon from '@mui/icons-material/Delete';  
import { DataGrid } from '@mui/x-data-grid';
import { useHistory } from 'react-router';
import IconButton from '@mui/material/IconButton';
import Tooltip from '@mui/material/Tooltip';


const MedicosTabla = () => {
  let history = useHistory();





const columns = [  

  {
    field: 'fullName',
    headerName: 'Nombre ',

    sortable: false,
    width: 200,
    valueGetter: (params) =>
      `${params.getValue(params.id, 'firstName') || ''} ${
        params.getValue(params.id, 'lastName') || ''
      }`,
  },
  {
    field: 'email',
    headerName: 'Correo electrónico', 
    width: 200,
  },
  { field: 'dni', headerName: 'Tipo y Número de Documento', width: 250 },
  { field: 'matricula', headerName: 'Matricula', width: 200 },
  { field: 'estado', headerName: 'Estado', width: 200 },
 { field: 'actions', headerName: 'Acciones', width: 200   , renderCell: (params) => {
  return (
    <div className="d-flex justify-content-between align-items-center" >
      <Tooltip title="Borrar">
        <IconButton>
          <DeleteIcon style={{ cursor: "pointer", margin: '20px' }} />
        </IconButton>
      </Tooltip>
      <Tooltip title="Modificar">
        <IconButton>
          <ModeEditIcon style={{ cursor: "pointer", margin: '20px' }} onClick={() => history.push("/abmMedico")} />
      </IconButton>
    </Tooltip> 
       </div>
  );
} }
];

const rows = [
  { id: 1, lastName: 'Mendez', firstName: 'Sara', email: 'sara987@gmail.com'  , dni : 'DNI 20980272' , matricula : '981626' , estado : 'Activo' , actions: ''},
  { id: 2, lastName: 'Mariana', firstName: 'Lopez',email: 'loperbs@gmail.com' , dni : 'DNI 28980656'  , matricula : '129800' , estado : 'Activo'  ,  actions: ''},
  { id: 3, lastName: 'Fernando', firstName: 'Jaime', email:'jaimeodon@gmail.com'  ,  dni : 'DNI 32772090'  ,matricula : '323226'  , estado : 'Activo',  actions: ''} 
];


  return (
    <div style={{ height: 400, width: '100%' }}>

    <DataGrid
      rows={rows}
      columns={columns}
      pageSize={5}
      rowsPerPageOptions={[5]}


    />
  </div>
  );
}
export default MedicosTabla;
